import React from "react";
import { Nav, Link, NavMenu } 
    from "./NavbarElements";
import './logo-image.css';
  
const Navbar = () => {
  return (
    <>
      <Nav>
        <NavMenu>
      
        <div className="logo-image">
            <img src="hospital-logo-icon.jpg" className="img-fluid"/>
        </div>
          <Link to="/Home" activeStyle>
            Home 
          </Link>
          {/* <NavLink to="/contact" activeStyle>
            Contact Us
          </NavLink>
          <NavLink to="/Login" activeStyle>
            Login
          </NavLink>
          <NavLink to="/Appointment" activeStyle>
            Appointment
          </NavLink>
         */}
        </NavMenu>
      </Nav>
    
    </>
  );
};
  
export default Navbar;
